import React from 'react';

const MainSection = ({ orders, totalDelivered }) => {
  const getPickedOrderIds = () => {
    const pickedOrders = orders.filter((order) => order.stage === 'Order Picked');
    return pickedOrders.map((order) => (
      <p key={order.id}>Order ID: {order.id}</p>
    ));
  };

  return (
    <div className="main-container">
      <h2>Main Section</h2>
      <table>
        <thead>
          <tr>
            <th>Order Placed</th>
            <th>Order in Making</th>
            <th>Order Ready</th>
            <th>Order Picked</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            {orders.map((order) => (
              <td key={order.id}>
                <p>Order ID: {order.id}</p>
                <p>Stage: {order.stage}</p>
                <p>Total time spent: {order.totalTime}</p>
              </td>
            ))}
          </tr>
        </tbody>
      </table>
      <div className="total-delivered">
        <h3>Total Delivered Today</h3>
        {getPickedOrderIds()}
      </div>
    </div>
  );
};

export default MainSection;
